    - Got hit by a driver with terrible insurance company. They don't want to pay.
      What should I do?
    - Long story short, I got rear ended by someone with American Access insurance.
      Never head of them either. It was their policy holder's fault. They ask me to
      send pictures of the damage, which I did. Today they call me and offer me $250
      for the damage. I immediately think.. No way. I go and get estimates from three
      reputable body shops in my area which range from $1500-1800. When I called them
      back, they tried to offer me $500. Bottom line is they are being extremely difficult,
      and it doesn't seem that I will get the money I need to fix my brand new car.
      I checked their google reviews and other people are having the same problems.
    - 5
