    - Is it okay to use a more powerful battery on a car?
    - I need a new battery for my car. Was considering an optima red top... I went
      to advanced auto and the right one for my car has 720 cold cranking amps and
      910 cranking amps. Then on ebay i found a brand new one cheap but slightly more
      powerful 800 cold cranking amps and 1000 cranking amps.. If i got the ebay one
      would that difference in power do me really wrong?
