    - If I have the title to my car in my possession with no lien holder stated, is
      the car technically mine?
    - 18 months ago I moved from one State to another. When I requested a copy of
      the title for registering in my new State, the Credit Union could not find it.
      They had to call the previous lien holder (we had refinanced to a lower rate),
      who also, could not find it. I had to apply for a new title (out of their pocket,
      NOT mine), and they sent the title (with no lien holder) to us. I don't know
      what the hell I'm doing so I just filed it away. Until about a week ago, the
      CU sent us a letter requesting it back, because obviously they have realized
      they lost it...AGAIN. So now I'm thinking, wait, If I HAVE the clear title,
      doesn't that mean I own it? Do I have to continue to pay? Technically, I have
      the truck and the title, possession is 9/10 of the law right? Thoughts?
    - 17
